import Profesor from './Profesores.jpg';
import Repo from './Repositorio.jpg'


function Inicio() {
  return (
    <div>
        <div class="Inicio">

<div class="profesor">
  <a href="./Views/Profesor.html">
  <img src={Profesor}/>
  </a>
</div>

<div class="materias">
  <a href="./Views/Materias.html">
  {/* <img src="./assets/Imagenes/Materias.jpg"> */}
  </a>
</div>

<div class="horario">
  <a href="./Views/Horario.html">
  {/* <img src="./assets/Imagenes/Horario.jpg"></a> */}
  </a>
</div>

<div class="repositorio">  
  <a href="./Views/Repositorio.html">
  {/* <img src="./assets/Imagenes/Repositorio.jpg"></a> */}
  </a>
</div>

</div>

    </div>
  );
}

export default Inicio;
